description:
GroupDocs.Viewer CLI - dotnet tool to view and convert over 170 file and document types.

Supported document formats:
   * Portable Document Formats - PDF (PDF/A-1a, PDF/A-1b, PDF/A-2a), XPS, OXPS, TEX;
   * Microsoft Word® Documents - DOC, DOCX, DOCM, DOT, DOTX, DOTM, RTF, TXT, VCF;
   * Apple SpreadSheets - NUMBERS;
   * Microsoft Excel® Spreadsheets - XLS, XLSX, XLSM, XLSB, CSV, TSV, XLAM, XLTX, FODS, SXC, SpreadsheetML;
   * Microsoft PowerPoint® Presentations - PPT, PPTX, PPS, PPSX, PPTM, POTX, POT, POTM, PPSM;
   * Microsoft Visio® Diagrams - VSD, VSDX, VSS, VST, VSTX, VSTM, VSSX, VSSM, VSX, VTX, VDW, VDX, SVG, SVGZ, VSDM;
   * Microsoft Project® Formats- MPP, MPT, MPX;
   * Microsoft OneNote® Formats - ONE;
   * Microsoft Outlook® Formats - PST, OST;
   * Open Document Formats - ODT, FODG, ODG, OTG, FODT, OTT, ODS, OTS, FODP, ODP, OTP;
   * Archive Formats - ZIP, TAR, BZ2, GZ, RAR, 7-Zip, XZ, TXZ, TGZ;
   * CAD Formats - DXF, DWG, DWT, STL, IFC, DWF, DGN, PLT, HPG, OBJ, CF2, IGS;
   * Ebook Formats - EPUB, MOBI;
   * Image Formats - CDR, CMX, TIFF, TIF, JPG, JPEG, PNG, GIF, BMP, ICO, TGA, JP2, J2C, J2K, JPF, JPX, JPM, DIF, WMF, WMZ, EMF, EMZ, WEBP, DJVU, CGM, PCL, PSD, PSB, DCM, PS, EPS, DIB;
   * Email Formats - EML, EMLX, MSG, MBox, NSF;
   * Markup Formats - HTM, HTML, MHT, MHTML, XML;
   * Programming Language Formats - AS, AS3, ASM, BAT, C, CC, CMAKE, CPP, CS, VB, CSS, CXX, DIFF, ERB, GROOVY, H, HAML, HH, JAVA, JS, JSON, LESS, LOG, M, MAKE, MD, ML, MM, PHP, PL, PROPERTIES, PY, RB, RST, SASS, SCALA, SCM, SCRIPT, SH, SML, SQL, VIM, YAML, PS1, PSD1, PSM1.
   * Web formats - CHM;

For more details on the GroupDocs.Viewer for .NET API, please visit product website at:
https://products.groupdocs.com/viewer

Note: GroupDocs.Viewer for .NET will run in evaluation mode. In order to test full features of the product, please request a free 30-day temporary license.
